import React from "react";

function EmployeeCreate() {
    return(
        <>
            <div className="form_creation">
                <p className="para_basic">Basic Details___________________________________________________________________________</p>
                <form>
                   <div>
                        <div className="customer_details">
                            <label>Customer Name*</label>
                            <input type="text" placeholder="customer-name" />
                        </div>
                        <div className="customer_details">
                            <label>Email*</label>
                            <input type="text" placeholder="customer-name" />
                        </div>
                   </div>
                    <div className="customer_details">
                        <label>Gender*</label>
                        <input type="text" placeholder="customer-name" />
                    </div>
                     <div className="customer_details">
                        <label>Mobile*</label>
                        <input type="text" placeholder="customer-name" />
                    </div>
                    <div>
                        <label>current_address</label>
                        
                    </div>
                </form>
            </div>
        </>
    )
}
export default EmployeeCreate
